import React from 'react';
import { Card } from 'antd';

const Index = () => {
    const dummy = [
        {
            title: "DSM공모전",
            admin: "김주성",
            body: "공모전을 위한 클래스"
        }
    ]
    return (
        <div>
            <Card title={dummy[0].title}>{dummy[0].body}</Card>
        </div>
    )
}

export default Index;
